import Card from "./Card";
import database from "../data_storage/database";

const Projects = () => {
  const makeCard = () => {
    for (let i = 0; i < Object.keys(database).length; i++) {
      const entries = Object.entries(database);
      console.log(entries[i]);
      return (
        <Card
          id={entries[i][0]}
          quote={entries[i][1].quote}
          description={entries[i][1].description}
        />
      );
    }
  };

  return (
    <section className="main">
      <div>
        <h1>Selected Projects</h1>
      </div>
      <ul>{makeCard()}</ul>
      <style jsx>
        {`
          .main {
            display: flex;
            flex-direction: column;
            margin: 0 120px;
            text-align: center;
          }
          h1 {
            font-size: 45px;
            margin-bottom: 50px;
          }
        `}
      </style>
    </section>
  );
};

export default Projects;
